import React from 'react';
import { Adsense } from '@ctrl/react-adsense';
// import './InnerPage.css';

function Blog() {

    return (
        <React.Fragment>
            {/* Head Section */}
            <section>
            </section>
            {/* googleAdsense */}
            <div className='googleAdsense'>
                <Adsense
                    client={process.env.REACT_APP_GOOGLE_ADSENSE}
                    slot={process.env.REACT_APP_GOOGLE_ADSENSE_SLOT}
                    style={{ display: 'block' }}
                    layout="in-article"
                    format="fluid"
                />
            </div>

            <div style="text-align: center; margin-top: 1rem;">
                <div style="text-align: center; margin-top: 0.5rem; margin-bottom: 0.5rem;">
                    <ins class="kakao_ad_area" style="display:none;" data-ad-unit="DAN-C8WGFc7Nw88wpR1S" data-ad-width="320"
                        data-ad-height="100"></ins>
                    <script type="text/javascript" src="//t1.daumcdn.net/kas/static/ba.min.js" async></script>
                </div>
            </div>

            {/* Button Section  */}

            <section>
            </section>

            {/* Container Section */}

            <section>               
            </section>

            {/* Footer */}

            <footer> 
                <div style="text-align: center; margin-top: 1rem;">
                    <ins class="kakao_ad_area" style="display:none;" data-ad-unit="DAN-49FS30iHGOn0dnLe" data-ad-width="300"
                        data-ad-height="250"></ins>
                    <script type="text/javascript" src="//t1.daumcdn.net/kas/static/ba.min.js" async></script>
                </div>
            </footer>
        </React.Fragment>
    );
};

export default Blog;
